import React from "react"





class Navbar extends React.Component{
    render(){
        return(
                <section id="header" className="dark">
                    <header>
                        <h1>What it means to meditate</h1>
                        <p>Are you stressed? take a walk far from home and find a serene place to think about everything.
                        </p>
                    </header>
                </section>
        )
    }
}

export default Navbar
